import React from 'react';
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";
import ProjectCard from './ProjectCard';
import projectData from './projectData';
import Project from './Project';

class Projects extends React.Component{
    render(){
        const projects = projectData.map(
            proj => <ProjectCard key={proj.id} title={proj.title} image={proj.image}/>
        );
        console.log(this.props);
        return(
            <div>
                <div class="row projectsContent">
                {projects}
                <br></br>

                </div>
                <a class="btn btn-outline-success">Project 1</a>
                <a class="btn btn-outline-success">Project 2</a>
                <a class="btn btn-outline-success">Project 3</a>
                {projectData.map((proj, index) => (
                    <h5 key={index}>
                    <Link to={`/projects/${index + 1}`}>{proj.name}'s Page</Link>
                    </h5>
                ))}

            </div>
        );

    }
}

const Proj = ({match}) => {
    const proj = projectData.find((proj) => {
        return parseInt(match.params.project) === proj.id;
    })

    return <>
        {match.isExact && <>
            <h1>{proj.title}</h1>
        </>}
    </>
};



export default Projects;
